CREATE TABLE `business` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `BusinessID` varchar(300) NOT NULL,
  `Name` varchar(300) NOT NULL,
  `URL` varchar(300) NOT NULL,
  `Rating` double NOT NULL,
  `ReviewCount` int(11) NOT NULL,
  `Phone` varchar(50) DEFAULT NULL,
  `Address_Line1` varchar(300) DEFAULT NULL,
  `Address_Line2` varchar(300) DEFAULT NULL,
  `City` int(11) DEFAULT NULL,
  `State` int(11) DEFAULT NULL,
  `Country` int(11) DEFAULT NULL,
  `PostalCode` int(11) DEFAULT NULL,
  `ImageURL` varchar(300) DEFAULT NULL,
  `RatingImgURL` varchar(300) DEFAULT NULL,
  `RatingImgURLSmall` varchar(300) DEFAULT NULL,
  `RatingImgURLLarge` varchar(300) DEFAULT NULL,
  `Snippet` varchar(500) DEFAULT NULL,
  `SnippetImageURL` varchar(300) DEFAULT NULL,
  PRIMARY KEY (`ID`),
  KEY `city_idx` (`City`),
  KEY `state_idx` (`State`),
  KEY `country_idx` (`Country`),
  KEY `postal_code_idx` (`PostalCode`),
  CONSTRAINT `city` FOREIGN KEY (`City`) REFERENCES `cities` (`ID`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `country` FOREIGN KEY (`Country`) REFERENCES `countries` (`ID`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `pc` FOREIGN KEY (`PostalCode`) REFERENCES `postal_codes` (`ID`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `state` FOREIGN KEY (`State`) REFERENCES `states` (`ID`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=13046 DEFAULT CHARSET=utf8;
